import React from 'react';

var Proset = {
    Problem: 'Test',
    Choice1: '1',
    Choice2: '2',
    Choice3: '3',
    Choice4: '4',
    Answer: 3
}

class Popup extends React.Component {
    show() {
        console.log(Proset)
        alert(Proset);
    }

    rneder () {
        return (
            this.show()
        )
    }
}

export default Popup;
